.background{
    position: absolute;
    right: 0;
    top: 100px;
    margin-right: 20px;
    z-index: 1000;
}

.img-1{
    background-color: transparent;
    height: 150px;
    position: absolute;
    top: -15vh;
    right: 250px;    
}

.img-2{
    position: absolute;
    height: 150px;
    right: -40px;
    top: 2vh;
}

.img-3{
    height: 120px;
    position: absolute;
    right: -20px;
    top: 35vh;
}

.img-4{
    height: 150px;
    position: absolute;
    top: 68vh;
    right: -20px;
}
.img-5{
    height: 150px;
    position: absolute;
    top: 70vh;
    right: 350px;
}
img{
    will-change: filter;
    transition: filter 300ms;
}


img:hover{
    transform: scale(110%);
    transition: all .5s;
    transform-style: flat;
    filter: drop-shadow(0 0 100px #313bf2);

    
}


